_BetBaseLibs_.jQuery = $.noConflict();


var BetBaseAPI = function(options) {

  if (!options.casino_id) {
    console.log('[BetBase] Error! You must provide a valid casino ID (e.g. var betbase = new BetBase(\'casino_id\');)');
    return;
  }
  
  var self = this;

  self.version = 0.01;
  
  var $ = _BetBaseLibs_.jQuery;
  var io = _BetBaseLibs_.io;  

  var defaults = {
    anonymous_login: true,
    casino_id: options.casino_id
  };

  self.options = $.extend({}, defaults, options || {});
  
  self.trusted = false;

  
  var clientSession = _BetBaseLibs_.getCookie('BetBase_clientSessionHash');
  if (!clientSession) {
		clientSession = _BetBaseLibs_.randomString(24);
    _BetBaseLibs_.setCookie('BetBase_clientSessionHash', clientSession);
  }
  
  self.ready = function (fn) {
    if (isReady) {
      fn(isReady);
      return;
    }
    ready.push(fn);
  }
  var ready = [];
  
	
  var socket = {
    
    connectionReady: false,
    
    receive: function () {
      
      if (this.socketObj && this.socketObj.readyState == 1) {
        console.log('[BetBase] Error! Socket is already active.');
        return;      
      } 
      
      var s = io.connect('wss://api.betbase.io', { path: '/socket' });

      var onevent = s.onevent;
      s.onevent = function (packet) {
          var args = packet.data || [];
          onevent.call (this, packet);
          packet.data = ["*"].concat(args);
          onevent.call(this, packet);
      };
      
      s.onopen = () => {
        if (this.socketOnAction['_open'])
          this.socketOnAction['_open'].forEach((fn) => {
            fn(s);
          });        
      };
      s.on('connect', s.onopen);
      s.onclose = () => {
        if (this.socketOnAction['_close'])
          this.socketOnAction['_close'].forEach((fn) => {
            fn(s);
          });        
      };
      s.on('close', s.onclose);
      s.onerror = (e) => {
        console.log('[BetBase] Error! Socket error:');
        console.log(e);       
        if (this.socketOnAction['_error'])
          this.socketOnAction['_error'].forEach((fn) => {
            fn(e);
          });        
      };
      s.on('error', s.onerror);
      s.on('*', (ev, data) => {
        if (this.socketOnAction[ev])
          this.socketOnAction[ev].forEach((fn) => {
            fn(data);
          });
      });
      
      this.socketObj = s;
    },
    on: function (action, fn) {
      if ( !this.socketOnAction[action] )
        this.socketOnAction[action] = [];
      this.socketOnAction[action].push(fn);
    },
    socketObj: false,
    socketOnAction: {}
    
  };
  
  socket.on('_open', (data) => {
    socket.connectionReady = true;
    sendIframe();
  });
  
  var sendIframe = function() {
    var anon = (self.options.anonymous_login) ? 'yes' : 'no';
    var src = 'https://api.betbase.io/init/' + self.options.casino_id + '?anon=' + anon + '&io_id=' + socket.socketObj.id + '&csid=' + clientSession;
    $.ajax({
      'url': src,
      'jsonp': 'callback',
      'dataType': 'jsonp',
      'success': (data) => {},
      'error': (err) => {
        console.log(err);
      }
    });
  };
  
  socket.on('init', (data) => {
    
    if (!isReady)
      ready.forEach((fn) => {
        fn();
      });    

    isReady = $.extend(true,{},data);
    
    if (data.clientAuth) {
      delete data.clientAuth;
      delete data.logged;
      if (socket.socketOnAction['login'])
        socket.socketOnAction.login.forEach((fn) => {
          fn(data);
        });
    }

  });
  var isReady = false;
  
  socket.on('re-init', () => {
    sendIframe();
  });

  socket.on('err', (data) => {
    console.log('Error:');
    console.log(data);
  });
  
  socket.on('bets_trusted', () => {
    self.trusted = true; 
  });
  

  var dialog = (data) => {
    var windowUrl = data.url;
    var windowName = data.name ? data.name : 'betbase-dialog';
    var windowOpts = data.opts ? data.opts : 'width=421,height=460,left=100,top=100';
    var windowRef = window.open(windowUrl, windowName, windowOpts);
    windowRef.focus();                
  };

  socket.receive();

  self.listen = function (ev, fn) {
    socket.on(ev, fn);
  };                                                       
  
  self.api = function (endpoint, options, fn) {
    if (!socket.connectionReady) {
      console.log('[BetBase] Error! BetBase.api(...) called before connection initialized.');
      return;
    }      
    
    if (typeof fn === 'undefined' && typeof options === 'function') { 
        fn = options;
    }
    
    if (!fn) {
      console.log('[BetBase] Error! BetBase.api(...): You must specify a function as a third (or second) argument.')
      return;
    }
        
    var reqHash = _BetBaseLibs_.randomString(10);
    
    socket.socketObj.emit('api', {
      auth: (isReady.clientAuth) ? isReady.clientAuth : false,
      requestHash: reqHash,
      request: {
        endpoint: endpoint,
        options: options
      }
    });
    
    socket.on('api-'+reqHash, (data) => {
      delete socket.socketOnAction['api-'+reqHash];
      fn(data.answer);
    });
    
  };
  
  
  self.login = function () {    
    dialog({
      url: 'https://betbase.io/dialog/login?csid=' + clientSession + '&cid=' + options.casino_id
    });
  };                                                           
  self.fair = function () {    
    if (!socket.connectionReady || !isReady || !isReady.clientAuth) {
      console.log('[BetBase] Error! BetBase.fair() called before socket authorized.')
      return;
    }
    dialog({
      url: 'https://betbase.io/dialog/provably-fair?cid=' + options.casino_id
    });
  };                                                           
  self.faucet = function () {    
    if (!socket.connectionReady || !isReady || !isReady.clientAuth) {
      console.log('[BetBase] Error! BetBase.fair() called before socket authorized.')
      return;
    }
    dialog({
      url: 'https://betbase.io/dialog/faucet?cid=' + options.casino_id
    });
  };                                                           
  self.deposit = function () {    
    if (!socket.connectionReady || !isReady || !isReady.clientAuth) {
      console.log('[BetBase] Error! BetBase.deposit() called before socket authorized.')
      return;
    }
		dialog({
      url: 'https://betbase.io/dialog/deposit?cid=' + options.casino_id
    });
  };                                                           
  self.withdraw = function () {    
    if (!socket.connectionReady || !isReady || !isReady.clientAuth) {
      console.log('[BetBase] Error! BetBase.withdraw() called before socket authorized.')
      return;
    }
    dialog({
      url: 'https://betbase.io/dialog/withdraw?cid=' + options.casino_id
    });
  };                                                           
  
};

_BetBaseLibs_.getCookie = function (cname) {
    var name = cname + "=";
    var ca = document.cookie.split(';');
    for(var i = 0; i <ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0)==' ') {
            c = c.substring(1);
        }
        if (c.indexOf(name) == 0) {
            return c.substring(name.length,c.length);
        }
    }
    return "";
};

_BetBaseLibs_.setCookie = function (name,value,days) {
    if (!days) days = 3650;
    if (days) {
        var date = new Date();
        date.setTime(date.getTime()+(days*24*60*60*1000));
        var expires = "; expires="+date.toGMTString();
    }
    document.cookie = name+"="+value+expires+"; path=/";
};
_BetBaseLibs_.randomString = function (len, charSet) {
    charSet = charSet || 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    var randomString = '';
    for (var i = 0; i < len; i++) {
    	var randomPoz = Math.floor(Math.random() * charSet.length);
    	randomString += charSet.substring(randomPoz,randomPoz+1);
    }
    return randomString;
};
